import React from 'react'
import { Menu } from 'antd';
import { UserOutlined, SearchOutlined } from '@ant-design/icons';

const { SubMenu } = Menu;

class Navbar extends React.Component {
  handleClick = e => {
    console.log('click ', e);
    this.setState({ current: e.key });
  };

  render() {
    const { current } = this.state;
    return (
      <Menu onClick={this.handleClick} selectedKeys={[current]} mode="horizontal" theme='dark' style={{ backgroundColor: '#5C082A', display:'flex', flexDirection:'row-reverse'}}>
        <SubMenu key="SubMenu" icon={<UserOutlined />} title='PROFILE' style={{ backgroundColor: '#5C082A'}}>
            <Menu.Item key="setting:1" >YOUR PROFILE</Menu.Item>
            <Menu.Item key="setting:2" >BOOKING</Menu.Item>
            <Menu.Item key="setting:3" >SIGN OUT</Menu.Item>
        </SubMenu>
        <Menu.Item key="search" icon={<SearchOutlined />}  style={{ backgroundColor: '#5C082A'}}>
            SEARCH
          <a href="https://ant.design" target="_blank" rel="noopener noreferrer"></a>
        </Menu.Item>
      </Menu>
    );
  }
}

export default Navbar
